import './header.css';
import houselogo from './house-logo.png';

function Headerbanner(){
  return(
    <>
      <p className="headerbanner">
        <p className="flushedleft"><img src={houselogo} alt="logo" className="compLogo"/></p>
        <p className="flushedleft">company name</p>
        <p className="filler"></p>
        <p className="flushedright">search</p>
        <p className="flushedright">listings</p>
        <p className="flushedright">favourites</p>
        <p className="flushedright">profile</p>
      </p>
    </>
  );
}

export default Headerbanner;
